const Singledev = ({ name, location, skill, photo }) => {
  return (
    <div className="col-md-4 text-center">
      <div className="team-member p-3 shadow">
        <img src={props.photo} alt="" />
        <h4>{props.name}</h4>
        <h6>{props.skill}</h6>
        <h6>{props.location}</h6>
      </div>
    </div>
  );
};
export default Singledev;
